const styles = {
    bar: {
        height: '100vh',
        width: '10%',
        backgroundColor: 'rgb(24,24,24',
        float: 'left'

    },
    text: {
        color: 'white'
    }
}

const Sidebar = () => {

    return(

        <React.Fragment>
            <div style={styles.bar}>
                <p style={styles.text}>sidebar</p>
                <div className="w3-padding w3-xlarge">
                <i className="fa fa-home" className='w3-xxlarge'></i>
                </div>
            </div>
        </React.Fragment>
    )
}
export default Sidebar
